{"settings":"{
  "workbench.iconTheme": "file-icons",
  "workbench.colorCustomizations": {
    "editor.selectionHighlightBackground": "#00FAA090",
    "editor.findMatchHighlightForeground": "#00FAA090",
    "editor.findMatchHighlightColor": "#00FAA090"
  },
  "vim.searchHighlightColor": "#00FAA8DA",
  "workbench.settings.applyToAllProfiles": ["vim.searchHighlightColor"],
  "vim.searchMatchColor": "#00FAA8DA",
  "editor.tokenColorCustomizations": {},
  "editor.formatOnSave": true,
  "rust-analyzer.rustfmt.rangeFormatting.enable": true,
  "rust-analyzer.rustfmt.rangeFormatting.overrideCommand": ["cargo", "fmt"],
  "workbench.colorTheme": "Semi dark theme in yellow",
  "editor.cursorSurroundingLines": 12,
  "workbench.editor.wrapTabs": true,
  "gitlens.views.commitDetails.files.layout": "list",
  "genieai.promptPrefix.customPrompt1-enabled": true,
  "tabnine.experimentalAutoImports": true,
  "debug.allowBreakpointsEverywhere": true,
  "editor.lineNumbers": "relative",
  "chat.commandCenter.enabled": false,
  "editor.fontFamily": "JetBrains Mono NL Light, Consolas, 'Courier New', monospace",
  "terminal.integrated.fontFamily": "JetBrains Mono Thin",
  "workbench.editor.tabSizing": "shrink",
  "window.density.editorTabHeight": "compact",
  "highlight.regexes": {
    "((?:<!-- *)?(?:#|// @|//|./\\*+|<!--|--|\\* @|{!|{{!--|{{!) *TODO(?:\\s*\\([^)]+\\))?:?)((?!\\w)(?: *-->| *\\*/| *!}| *--}}| *}}|(?= *(?:[^:]//|/\\*+|<!--|@|--|{!|{{!--|{{!))|(?: +[^\\n@]*?)(?= *(?:[^:]//|/\\*+|<!--|@|--(?!>)|{!|{{!--|{{!))|(?: +[^@\\n]+)?))": {
      "filterFileRegex": ".*(?<!CHANGELOG.md)$",
      "decorations": [
        {
          "overviewRulerColor": "#00FFFF",
          "backgroundColor": "#00FFFF",
          "color": "#1f1f1f",
          "fontWeight": "bold"
        },
        {
          "backgroundColor": "#AADDDD",
          "color": "#1f1f1f"
        }
      ]
    },
    "((?:<!-- *)?(?:#|// @|//|./\\*+|<!--|--|\\* @|{!|{{!--|{{!) *(?:FIXME|FIX|BUG|UGLY|DEBUG|HACK)(?:\\s*\\([^)]+\\))?:?)((?!\\w)(?: *-->| *\\*/| *!}| *--}}| *}}|(?= *(?:[^:]//|/\\*+|<!--|@|--|{!|{{!--|{{!))|(?: +[^\\n@]*?)(?= *(?:[^:]//|/\\*+|<!--|@|--(?!>)|{!|{{!--|{{!))|(?: +[^@\\n]+)?))": {
      "filterFileRegex": ".*(?<!CHANGELOG.md)$",
      "decorations": [
        {
          "overviewRulerColor": "#cc0000",
          "backgroundColor": "#cc0000",
          "color": "#1f1f1f",
          "fontWeight": "bold"
        },
        {
          "backgroundColor": "#cc0000",
          "color": "#1f1f1f"
        }
      ]
    },
    "((?:<!-- *)?(?:#|// @|//|./\\*+|<!--|--|\\* @|{!|{{!--|{{!) *(?:REVIEW|OPTIMIZE|TSC)(?:\\s*\\([^)]+\\))?:?)((?!\\w)(?: *-->| *\\*/| *!}| *--}}| *}}|(?= *(?:[^:]//|/\\*+|<!--|@|--|{!|{{!--|{{!))|(?: +[^\\n@]*?)(?= *(?:[^:]//|/\\*+|<!--|@|--(?!>)|{!|{{!--|{{!))|(?: +[^@\\n]+)?))": {
      "filterFileRegex": ".*(?<!CHANGELOG.md)$",
      "decorations": [
        {
          "overviewRulerColor": "#00EE66",
          "backgroundColor": "#00EE66",
          "color": "#1f1f1f",
          "fontWeight": "bold"
        },
        {
          "backgroundColor": "#00EE66",
          "color": "#1f1f1f"
        }
      ]
    },
    "((?:<!-- *)?(?:#|// @|//|./\\*+|<!--|--|\\* @|{!|{{!--|{{!) *(?:IDEA)(?:\\s*\\([^)]+\\))?:?)((?!\\w)(?: *-->| *\\*/| *!}| *--}}| *}}|(?= *(?:[^:]//|/\\*+|<!--|@|--|{!|{{!--|{{!))|(?: +[^\\n@]*?)(?= *(?:[^:]//|/\\*+|<!--|@|--(?!>)|{!|{{!--|{{!))|(?: +[^@\\n]+)?))": {
      "filterFileRegex": ".*(?<!CHANGELOG.md)$",
      "decorations": [
        {
          "overviewRulerColor": "#cc00cc",
          "backgroundColor": "#cc00cc",
          "color": "#1f1f1f",
          "fontWeight": "bold"
        },
        {
          "backgroundColor": "#cc00cc",
          "color": "#1f1f1f"
        }
      ]
    }
  },
  "workbench.startupEditor": "terminal",
  "workbench.editor.empty.hint": "hidden",
  "[yaml]": {
    "editor.defaultFormatter": "esbenp.prettier-vscode"
  },
  "[html]": {
    "editor.defaultFormatter": "esbenp.prettier-vscode"
  },
  "security.workspace.trust.banner": "always",
  "security.workspace.trust.startupPrompt": "always",
  "security.workspace.trust.untrustedFiles": "open",
  "git.openRepositoryInParentFolders": "never",
  "[jsonc]": {
    "editor.defaultFormatter": "esbenp.prettier-vscode"
  },
  "tailwindCSS.validate": false,
  "github.copilot.enable": {
    "*": false,
    "plaintext": false,
    "markdown": false,
    "scminput": false,
    "rust": false
  },
  "github.copilot.chat.agent.autoFix": false,
  "github.copilot.chat.codeGeneration.useInstructionFiles": false,
  "github.copilot.chat.useProjectTemplates": false,
  "github.copilot.editor.enableCodeActions": false,
  "github.copilot.nextEditSuggestions.fixes": false,
  "github.copilot.renameSuggestions.triggerAutomatically": false,
  "github.copilot.chat.copilotDebugCommand.enabled": false,
  "github.copilot.chat.reviewSelection.enabled": false,
  "github.copilot.chat.startDebugging.enabled": false,
  "github.copilot.chat.agent.currentEditorContext.enabled": false,
  "github.copilot.nextEditSuggestions.enabled": false,
  "github.copilot.chat.scopeSelection": true,
  "github.copilot.chat.terminalChatLocation": "terminal",
  "rust-analyzer.rustfmt.overrideCommand": null,
  "rust-analyzer.linkedProjects": [],
